import {Component} from 'react';

import logo from './logo.svg';
import './App.css';

class App extends Component {

    constructor() {
        super();

        this.state = {
            name: 'Bruno',
            company: '8mm'
        }

    }

    render() {
        return (
            <div className="App">
                <header clas sName="App-header">
                    <img src={logo} className="App-logo" alt="logo"/>
                    <p>Oi, {this.state.name}, I Work at {this.state.company}!</p>
                    <button
                        onClick={() => {
                            this.setState({name : 'Bruno 2'});
                        }}>
                        Change name
                    </button>
                </header>
            </div>
        );
    }
}

export default App;
